        or1=get_or(person_list,day,'夜勤')
        or2=get_or(person_list,day-1,'夜勤')
        s="平日夜勤"+daydef[day]
        sc3.AddSoft(~(or1 &or2),s,3)#同じ所属の連続シフトを避ける

